import net.sf.json.groovy.*;
import groovy.json.JsonSlurper;

def response = context.expand( '${Display all product reservation items#response#$[\'items\']}' )

def json = new JsonSlurper().parseText (response);

for (int i=0; i < json.size(); i++)
{
	if(json[i].domain.toString()!="batchId"){
		return 1
	}
	else
		return 0
}
